// import axios from "axios";
export async function productsDat() {
  const data = await fetch("https://dummyjson.com/products");
  const products = await data.json();

  return products;
}

export const productsData = fetch("https://dummyjson.com/products")
  .then((res) => res.json())
  .then((data) => data);
